import React from 'react';
import axios from 'axios';

function GetAccountByID(userID = 1) {

    var url = 'http://localhost:8080/accounts/' + userID
    axios.get(url)
        .then(res=> {
            console.log(res.data)
        }).catch(err => {
            console.log(err)
        })
}

export default GetAccountByID;
